    /// Returns the _id_ for the [`Family`].
    pub fn id(&self) -> u32 {
        *self as u32
    }

    /// Returns the first [`Font`].
    pub fn font(&self) -> Font {
       Font::from_id(self.id())
    }

    /// Transforms an _id_ into a [`Family`].
